import { ReactComponent as CloseMenu } from "../../assets/x.svg";
import { ReactComponent as MenuIcon } from "../../assets/menu.svg";
import "./header.css";

const Header = () => {
  return (
    <div className="header">
      <div className="logo-nav">
        <div className="logo-container">
          <a href='#'>
            <Logo className="logo" /> 
          </a>
        </div>
      </div>
    </div>
  );
};

export default Header;
